def decode(b64s):
    returns = []
    for i in range(0, len(b64s), 3):
        pre = ord(b64s[i]) - 48
        mid = ord(b64s[i + 1]) - 48
        post = ord(b64s[i + 2]) - 48
        num = pre * 4096 + mid * 64 + post
        neg = False
        if num > 100000:
            neg = True
            num -= 100000
        num = num / 100000
        if neg:
            num = -num
        returns.append(num)
    return returns

